import React from 'react';
import {
    ChakraProvider,
    Box,
    Text,
    Container,
    Flex,
    Stack,
    Button,
    useColorMode,
    Center,
    Image,
    boxShadow,

} from '@chakra-ui/react';
import theme from '../../theme/theme';


const Skills = () => {

    return (
        <ChakraProvider theme={theme}>
            <Container
                maxW='container.xxl'
                bgColor='white'
                pb={['3vw', '1vw']}
                px={['3vw', '5vw']}
                id='skills'
            >
                <Center>
                    <Center
                        minW={['75vw', '10vw']}
                        bgColor='white'
                        borderRadius={['75vw', '10vw']}
                        border='2px'
                        color='Black'
                        padding='1vw'
                        margin='1vw'
                        fontWeight={'bold'}
                    >
                        Skills
                    </Center>

                </Center>
            </Container >
        </ChakraProvider>
    );
}

export default Skills;
